import React from "react";
import { NavLink, useHistory } from "react-router-dom";
import NavItem from "../components/NavBar/NavItem";
import axios from "axios";

function Clear_data() {
  const [response, setResponse] = useState(null);

  const getResults = async () => {
    try {
      const response = await axios.get("http://localhost:5000/clear_data");
      console.log(response.data);
      setResponse(response.data); // Set the response state with the data
    } catch (error) {
      alert('Logging Error: ' + error.response.data.error);
    }
  };

  useEffect(() => {
    getResults();
  }, []);

  return (
    <div>
      <h2>All the data is deleted</h2>
    </div>
  );
}


export default Clear_Data;
